const FaustinaRegular = `@font-face { font-family: 'Faustina'; font-style: normal; font-weight: 400; src: local('Faustina Regular'), local('Faustina-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const FaustinaItalic = `@font-face { font-family: 'Faustina'; font-style: italic; font-weight: 400; src: local('Faustina Italic'), local('Faustina-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina500 = `@font-face { font-family: 'Faustina'; font-style: normal; font-weight: 500; src: local('Faustina Medium'), local('Faustina-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina500italic = `@font-face { font-family: 'Faustina'; font-style: italic; font-weight: 500; src: local('Faustina Medium Italic'), local('Faustina-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina600 = `@font-face { font-family: 'Faustina'; font-style: normal; font-weight: 600; src: local('Faustina SemiBold'), local('Faustina-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina600italic = `@font-face { font-family: 'Faustina'; font-style: italic; font-weight: 600; src: local('Faustina SemiBold Italic'), local('Faustina-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina700 = `@font-face { font-family: 'Faustina'; font-style: normal; font-weight: 700; src: local('Faustina Bold'), local('Faustina-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Faustina700italic = `@font-face { font-family: 'Faustina'; font-style: italic; font-weight: 700; src: local('Faustina Bold Italic'), local('Faustina-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
